message:
Achei o relatório excelente…

O TSE gerou muita dificuldade para auditoria, porém consigo ver alguns pontos importantes:

- Nao foi concedido acesso completo ao código fonte;

- Nao foi concedido acesso as bibliotecas utilizadas;

- Foi apontado que o servidor que realiza a compilação fica acessível pela rede;

- Foi apontado fragilidade no processo de compilação, controle de versão e distribuição do binário;

- Foi pedido uma comissão para analisar no detalhe os binários;

Por final… não foi possível garantir que as urnas são seguras.

Entendo que dado objeto da auditoria e limitações que tiveram… o relatório foi muito bom

Paulo Figueiredo Filho
@realpfigueiredo
